import React from "react";
import { Link } from 'react-router-dom';


function ArtistsCard(props) {
    return (
        <div class="card  text-white">
            <img class="card-img-top" src="./public/logo192.png" alt="artistsPic" />
            <div class="card-header">

                {props.id == 1 ? (
                    <Link to={`/artists/artistspage/staticinstance1`}>{props.ArtistsName}</Link>
                ) : null}
                {props.id === 2 ? (
                    <Link to={`/artists/artistspage/staticinstance2`}>{props.ArtistsName}</Link>
                ) : null}
                {props.id === 3 ? (
                    <Link to={`/artists/artistspage/staticinstance3`}>{props.ArtistsName}</Link>
                ) : null}

                {/* <Link to={`/artists/artistspage/${props.id}`}>{props.ArtistsName}</Link> */}
            </div>
            <div class="card-header">{props.Genre}</div>
            <div class="card-body p-5">{props.VenueList}</div>

        </div>


    );

}

export default ArtistsCard;
